    <Typography variant="body1" id="about-text">
      SafeHealthyKind, founded by an ICU Physician and a software engineer, was created for healthcare workers—to validate you and provide a place for you to share your fears and frustrations and, in turn, comfort and be comforted by your peers. 
      <br /><br />
      COVID-19 challenges our psyche. In the face of fear, isolation, and sadness, we must do what is right: <strong>Be Safe. Be Healthy. Be Kind.</strong>
      <br /><br />
      These stories are true — authored by healthcare workers in this very real pandemic. Return to this site to tell your story and support others.
    </Typography>

